import axios from "axios";
const API_URL = "http://localhost:3080/login";

export const loginAccount = async (dataFormLogin) => {
  try {
    const response = await axios.post(API_URL, dataFormLogin);
    return response.data;
  } catch (err) {
    console.error(err);
    throw err;
  }
};
export const register = async (dataFormLogin) => {
  try {
    const response = await axios.post(API_URL, dataFormLogin);
    return response.data;
  } catch (err) {
    console.error(err);
    throw err;
  }
};
